public boolean equals(Object other) {
  if (!(other instanceof FileRegion)) {
    return false;
  }
  FileRegion o = (FileRegion) other;
  return blockId == o.blockId
    && offset == o.offset
    && length == o.length
    && genStamp == o.genStamp
    && path.equals(o.path);
}
